import Toolbar from '@mui/material/Toolbar';
import Divider from '@mui/material/Divider';
import List from '@mui/material/List';
import ListItem from '@mui/material/ListItem';
import ListItemButton from '@mui/material/ListItemButton';
import ListItemText from '@mui/material/ListItemText';

async function getHalls()
{
    let data = null;
    await fetch('http://localhost:5000/halls')
    .then((response) => response.json())
    .then(halls => data=halls)
    .catch((err) => data = ["error. try later."]);
    return data;
}

function NavList({setSelectedHall})
{
    const halls = getHalls();
    console.log("haals: " + halls)

    return (
        <>
        <Toolbar />
        <Divider />
        <List>
        { !halls ? null : halls.map((text) => (
            <>
            <ListItem key={text} disablePadding>
                <ListItemButton onClick={() => setSelectedHall(text)}>
                <ListItemText primary={text} />
                </ListItemButton>
            </ListItem>
            <Divider />
            </>
            ))}
        </List>
        </>
    );
}

export default NavList;
